import { createAsyncThunk, createSlice } from '@reduxjs/toolkit';
import { fetchCount } from './counterAPI';

const initialState = {
    data: []
};

export default function tableReducer(state = initialState, action) {
    switch (action.type) {
        case 'GET_DATA_SUCCESSFULL':
            return update(state, {
                data: { $set: action.payload }
            })
        default:
            return state
    }
}
